import Link from "next/link";

function IndexPage() {
  return (
    <div>
      <Link href='/details'>
        <a>Go To Details</a>
      </Link>
      <br />
      <Link href='/'>
        <a>Go Back</a>
      </Link>
    </div>
  );
}

export default IndexPage;
